import { Link } from "react-router-dom";
import { useSelector, useDispatch } from "react-redux";
import { useEffect, useState } from "react";
import axios from "axios";

export function Navbar() {
  const userLogged = useSelector((state) => state.user);
  const [userData, setData] = useState([]);
  let logged = false;

  const len = userLogged.users.length - 1;
  if (userLogged.users.length !== 0) {
    logged = userLogged.users[len].isLoggedIn;
  }

  const admin = userLogged.users[len].isAdmin;
  const dispatch = useDispatch();

  useEffect(() => {
    axios
      .get("https://fakestoreapi.com/users", { params: { limit: 5 } })
      .then((response) => {
        setData(response.data);
      })
      .catch((error) => {
        console.error("Error fetching data:", error);
      });
    for (const obj of userData) {
      dispatch(
        registerUser(
          obj.id,
          obj.name.firstname,
          obj.name.obj.email,
          obj.password
        )
      );
    }
  }, []);
  //storing the first five users as registered users
  return (
    <div className="NAV">
      <Link to="/">E-COM</Link>
      <ul>
        <li>Hello! {userLogged.users[len].email}</li>
        {!logged && <Link to="/login">Login</Link>}
        {logged && <Link to="/user">Login</Link>}
        {!logged && <Link to="/register">Register</Link>}
        <Link to="/user">User</Link>

        {admin ? (
          <Link to="/allUsers">All Users</Link>
        ) : (
          <Link to="/cart">Cart</Link>
        )}
      </ul>
    </div>
  );
}
